import React from "react";
import Link from "next/link";
import '../../styles/landingpage/index.scss'

export const Header = () => {
  return (
    <div className="header-container">
      <div className="lg">
        <p>WeNeibours</p>
        <p>whyWeNeibours</p>
        <p>Contact Us</p>
        <Link href="/signIn">
          <p>SignIn</p>
        </Link>
      </div>

      <div className="sm"></div>
    </div>
  );
};
